import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';

import './App.css';
import MazeGame from './MazeGame';
import NavBar from './NavBar';

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <MazeGame />
      </div>
    </Router>
  );
}

export default App;
